import React from "react"
import Tabs from "./IndiaTabs";
import Total from "./Total";


function India() {
    return(
        <div>
            <div>
                <img className="logo" src="./Images/India.png"></img>
            </div>
            <Total />
            <Tabs />
        </div>   
    )
}

export default India;
